import React from "react";
import TemplateAnime from "../Elementos/templateAnime"


function onepunch(){
    return(
        <div>
            <TemplateAnime LinkAnime="https://iframe.mediadelivery.net/embed/64523/bd99ca89-f495-4ed8-8885-8bd2654a274d?autoplay=true" TituloAnime="One-Punch Man " TituloCap="Episodio 1 – El hombre más poderoso del mundo" DescAnime="Saitama es un joven desempleado cuya afición es ser superhéroe. Pero tiene un problema: derrota a todos sus enemigos de un golpe."/>
        </div>
    );
}

export default onepunch;
